MACOSX_DEPLOYMENT_TARGET:
- '0'
MACOSX_SDK_VERSION:
- '0'
channel_sources:
- conda-forge
channel_targets:
- conda-forge main
cross_target_platform:
- linux-ppc64le
docker_image:
- quay.io/condaforge/linux-anvil-x86_64:alma9
rust_arch:
- powerpc64le-unknown-linux-gnu
rust_arch_env:
- POWERPC64LE_UNKNOWN_LINUX_GNU
rust_arch_env_build:
- AARCH64_UNKNOWN_LINUX_GNU
rust_default_cc:
- powerpc64le-conda-linux-gnu-cc
rust_default_cc_build:
- aarch64-conda-linux-gnu-cc
target_c_stdlib_version:
- '2.17'
target_platform:
- linux-aarch64
version:
- 1.92.0
zip_keys:
- - cross_target_platform
  - rust_arch
  - rust_arch_env
  - rust_default_cc
  - MACOSX_SDK_VERSION
  - MACOSX_DEPLOYMENT_TARGET
  - target_c_stdlib_version
  - channel_sources
  - channel_targets
  - version
